import React, { Component } from "react";

class Modal extends Component {
  constructor(props) {
    super();
    this.state = {
      memberInfo: props.memberInfo
    };
    console.log(props.memberInfo);
  }

  handleClickConfirm = () => {};

  render() {
    const { nickName, enrolledIn, cell } = this.state.memberInfo;

    return (
      <div className="modal">
        <div className="background">
          <div className="card">
            <span className="cancel"></span>
            <div className="row">
              <div className="key">닉네임</div>
              <input value={nickName} className="value" />
            </div>
            <div className="row">
              <div className="key">소속</div>
              <input value={cell} className="value" />
            </div>
            <div className="row">
              <div className="key">입사일</div>
              <input value={enrolledIn} className="value" />
            </div>
            <div className="button-wrapper">
              <button onClick={this.handleClickConfirm} className="change">
                확인
              </button>
              <button onClick={this.handleClickDelete} className="delete">
                삭제
              </button>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default Modal;
